  const docDefinitios = {
    pageSize: 'A4',
    pageMargins: [15, 99.5, 20, 40],
    pageOrientation: 'Landscape',
    header: [reportTitle],
    content: [details],
    footer: Rodape
  }

  pdfMake.createPdf(docDefinitios).open();
}



export default PDFProgramacao;
